export function Nav() {
    return <span>
        <a href='/'>
            <img className='indexBtn' src='/mffWIKI/img/logo121.jpg' />
        </a>
        <div className='navLeft'>
            <a className='navLeftSpan' href='/Registered' text='登入' />
            <a className='navLeftSpan' href='/Registered' text='/ 註冊' />
            <a className='navLeftSpan' href='/Change' />
            <span display='none' className='navLeftSpan' text='登出' onClick={deleteProcess} />
        </div>
        <div class='navRight'>
            <div className='hamburger'>
                <img src='/mffWIKI/img/hamburg.png' onClick={navSwitch} />
                <a className='hamburgerA' href='/Herolist' />
                <a className='hamburgerA' href='/Challenge' />
            </div>
            <a className='navRightA' text='遊戲角色' href='/Herolist' />
            <a className='navRightA' text='遊戲攻略' href='/Challenge' onClick={function () {
                localStorage.setItem("mode", '世界頭目');
                localStorage.setItem("idCName", '闇夜無星');
                localStorage.setItem("ChallengeOptionShadowDomain", '影域1F(接力模式)');
                localStorage.setItem('ChallengeOptionAlliance', ',英雄,近戰');
                localStorage.setItem('ChallengeRaiders', '麻痺(');
                localStorage.setItem('ChallengeOptionAllianceText', '星期一(近戰+英雄)');
                localStorage.setItem('ChallengeRaidersText', '麻痺');
                localStorage.setItem('ChallengeOptionMission', '劇情模式1-1(次元衝突)');
                localStorage.setItem('ChallengeWorldBossRecordLocation', 0)
            }} />
            <form class='serchBtn' onSubmit={serchBtnInput}>
                <input className='serchBtnInput' type='text' placeholder='搜尋關鍵字' />
                <img src='/mffWIKI/img/searchBTN.JPG' onClick={serchBtnInput} />
            </form>
        </div>
    </span>
}


export function Flooter() {
    return <flooter style={{
        position: "fixed",
        height: "40px",
        width: "100%",
        backgroundColor: "gray",
        zIndex: "80",
        bottom: "0",
        fontSize: "22px",
        lineHeight: "30px",
        fontWeight: "800",
        color: "white",
        textAlign: "center",
        borderTop: "5px inset rgb(238, 226, 226, 0.5)"
    }}
    // =======文字內容===================
    >網 石__版 權 所 有__2021
    </flooter>
}
